// Section.js
export default function Section({ title }) {
  const contentMap = {
    Home: "Selamat datang di portofolio saya!",
    About: "Saya adalah seorang web developer...",
    Education: "S1 Teknik Informatika, Universitas XYZ...",
    Skills: "JavaScript, React, Node.js, Tailwind CSS...",
    // Tambahkan sesuai halaman
  };

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">{title}</h1>
      <p className="text-gray-700">{contentMap[title] || "Konten belum tersedia."}</p>
    </div>
  );
}
